def org(s: DOI | Sequence[int],
        d: dict = ORGANIZATION) -> str | dict | None:
    k = s.prefix() if isinstance(s, DOI) else s
    while k:
        if k[0] not in d:
            return None
        d = d[k[0]]
        k = k[1:]
    return d
